var nextBtn = document.getElementById('nextBtn');
var prevBtn = document.getElementById('prevBtn');
var modal = document.getElementById('modalView');
var download = document.getElementById('downloadSurvey');
var answerList;
var totalQuestions = questions.length-1;

function showModal () {
	modal.style.display = "block";
	this.answerList = new surveyAnswers();
}

nextBtn.onclick = function(){

	//check which question number
	var index = answerList.getIndex();
	//collect input from user
	if(index >= totalQuestions){					//XXXX Change this so that its reading number of questions, this will make it so that questions are mutable.
		collectRadio(index);
		answerList.solve();
		document.getElementById('quiz').style.display = "none";
		document.getElementById('percTotal').innerHTML = Math.floor((answerList.getCountTotal()/((index+1)*5))*100)+"%";
		document.getElementById('responseChart').style.display = "block";
		google.charts.load("current", {packages:["corechart"]});
		google.charts.setOnLoadCallback(drawChart);
	} else if(index > -1){
		collectRadio(index);
		if(index !== 62) {setQuestionAnswer(index+1)};		
	} else {
		setQuestionAnswer(index+1);		
	}
	answerList.incrIndex();
	prevBtn.disabled = false;
};

prevBtn.onclick = function (){
	
	var index = answerList.getIndex();
	if(index >= -1){
		collectRadio(index);
		setQuestionAnswer(index-1);	
		answerList.decIndex();
		if (answerList.getIndex() === 0){
			prevBtn.disabled = true;
		}
	}  
	
};


    
function drawChart() {
	var data = google.visualization.arrayToDataTable(answerList.averages);

	var options = {
    	//title: 'My Daily Activities',
     	pieHole: 0.6,
		legend: 'none',
		pieSliceText: 'none',
		chartArea:{width:"70%",height:"70%"},
		colors:['375d4c','375d4c','375d4c',
				'cc984f','cc984f','cc984f',
				'487875','487875','487875',
				'c18429','c18429','c18429']
	};

	var chart = new google.visualization.PieChart(document.getElementById('piechart'));
  	chart.draw(data, options);
	chart.getImageURI();
}


function collectRadio(index){
	
	var radios;
	if(questions[index].type === "radio"){
		radios = document.getElementsByName('aptitude');
		for(var i = 0; i < radios.length; i++){
			if(radios[i].checked){
				answerList.addAnswer(i);
				radios[i].checked = false;			 
				break;
			}
		}
	} else {
		radios = document.getElementsByName('aptitudeBool');
		if(radios[0].checked){
			answerList.addAnswer(5);
			radios[0].checked = false;			 
		} else {
			answerList.addAnswer(0);
			radios[1].checked = false;
		}
	}
	
}

function setQuestionAnswer(index){
	
	var archAnswer = answerList.getAnswer(index);	
	var nextQ= questions[index]
	var radios;
	//set response type
	if(nextQ.type === "radio"){
		radios = document.getElementsByName('aptitude');
		document.getElementById('surveyRadio').style.display = "block";
		document.getElementById('surveyBool').style.display = "none";
		if(archAnswer != null){
			radios[archAnswer].checked = true;
		} else {
			radios[1].checked = true;
		}
	} else {
		radios = document.getElementsByName('aptitudeBool');
		document.getElementById('surveyRadio').style.display = "none";
		document.getElementById('surveyBool').style.display = "block";
		if(archAnswer === null || archAnswer === 0){
			radios[1].checked = true;
		} else {
			radios[0].checked = true;
		}
	}
	//set new question
	document.getElementById('question').innerHTML = nextQ.Query;
	document.getElementById('qNum').innerHTML = index+1 + "/" + (totalQuestions+1);
}

